/*
=== ANALISA FUNGSI TOKPEE ===

TRIGGER UTAMA:
1. MutationObserver (Yk) yang mengawasi perubahan DOM setiap 500ms
2. Dipanggil saat DOMContentLoaded
3. Mengecek domain (shopee/tokopedia) dan memanggil observe() yang sesuai

PLATFORM DETECTION:
- Shopee: jk, Hk, Mk, Wk (Search, Shop, Category, Product)
- Tokopedia: EC, vk, yk, Ck (Product, Search, Shop, Category)

FLOW EXECUTION:
1. MutationObserver detect DOM changes → 
2. Platform detection (shopee/tokopedia) →
3. Call observe() functions →
4. Check page type (search/shop/category/product) →
5. Extract URL parameters (getQuery, getCategoryId, etc.) →
6. Call showInfo() with extracted data →
7. Call getProducts() to fetch data →
8. Display results in UI

FUNGSI KUNCI:
- isCategoryPage(): Cek apakah di halaman kategori
- getCategoryId(): Extract category ID dari URL
- getQuery(): Extract query parameters dari URL
- getCategoryProduct(): Fetch product data dari API
- getProducts(): Main function untuk mengambil data produk
- showInfo(): Initialize UI dan mulai proses analisa

KAPAN TERPANGGIL:
- Setiap kali ada perubahan DOM (navigasi halaman, filter, sorting)
- Saat pertama kali load halaman
- Saat user mengubah filter/sorting di marketplace
- Saat pindah antar halaman produk

*/

